  input: '"TEXT","F3A","C00379735","In our original report, a reimbursement of the
    campaign was inadvertently reported as a contribution (line 11(a)) instead of
    an offset to operating expenditures (line 14).  The item in question is a $1,254.50
    reimbursement by John Woods, the campaign manager during the 2002 election and
    Congressman Coles district director starting early in January 2003.  The reimbursement
    was for the cost of an airline ticket so Mr. Woods could attend the orientation
    of newly elected Members of Congress in Washington, D.C in November 2002.  The
    campaign was not aware when the airline ticket was purchased that the U.S. House
    of Representatives would pay for the flight.  At the request of the Clerk of the
    House, Mr. Woods was given a $1,254.50 reimbursement from the U.S. Treasury so
    that he could in turn reimburse Cole for Congress.  Upon receiving a check from
    the U.S. Treasury, Mr. Woods immediately reimbursed Cole for Congress and it is
    the administrative record of this action we are seeking to clarify today.  Please
    refer to the attached letter."'
